import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import MenuItemCard from '../components/MenuItemCard';
import { restaurantAPI, menuAPI } from '../utils/api';
import { useCart } from '../context/CartContext';

const RestaurantMenu = () => {
  const { id } = useParams();
  const [restaurant, setRestaurant] = useState(null);
  const [menuItems, setMenuItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const { setRestaurant: setCartRestaurant, clearCart } = useCart();

  useEffect(() => {
    fetchRestaurantAndMenu();
  }, [id]);

  const fetchRestaurantAndMenu = async () => {
    try {
      const [restaurantResponse, menuResponse] = await Promise.all([
        restaurantAPI.getById(id),
        menuAPI.getByRestaurant(id)
      ]);

      setRestaurant(restaurantResponse.data);
      setMenuItems(menuResponse.data);
      setCartRestaurant(restaurantResponse.data);
      clearCart(); // Clear cart when switching restaurants
    } catch (error) {
      setError('Failed to fetch restaurant menu');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div style={styles.loading}>Loading menu...</div>;
  }

  if (error) {
    return <div style={styles.error}>{error}</div>;
  }

  if (!restaurant) {
    return <div style={styles.error}>Restaurant not found</div>;
  }

  return (
    <div style={styles.container}>
      <div style={styles.header}>
        <img 
          src={restaurant.image} 
          alt={restaurant.name}
          style={styles.image}
          onError={(e) => {
            e.target.src = 'https://via.placeholder.com/800x300?text=Restaurant';
          }}
        />
        <div style={styles.info}>
          <h1 style={styles.name}>{restaurant.name}</h1>
          <p style={styles.cuisine}>{restaurant.cuisine}</p>
          <div style={styles.details}>
            <span style={styles.rating}>‚≠ê {restaurant.rating}</span>
            <span style={styles.deliveryTime}>üïí {restaurant.deliveryTime}</span>
          </div>
          <p style={styles.address}>üìç {restaurant.address}</p>
        </div>
      </div>

      <div style={styles.menuSection}>
        <h2 style={styles.menuTitle}>Menu</h2>
        {menuItems.length === 0 ? (
          <div style={styles.empty}>
            <p>No menu items available.</p>
          </div>
        ) : (
          <div style={styles.grid}>
            {menuItems.map(item => (
              <MenuItemCard key={item._id} item={item} />
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '2rem'
  },
  header: {
    backgroundColor: 'white',
    borderRadius: '8px',
    boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
    overflow: 'hidden',
    marginBottom: '2rem'
  },
  image: {
    width: '100%',
    height: '300px',
    objectFit: 'cover'
  },
  info: {
    padding: '2rem'
  },
  name: {
    fontSize: '2rem',
    fontWeight: 'bold',
    marginBottom: '0.5rem'
  },
  cuisine: {
    fontSize: '1.2rem',
    color: '#666',
    marginBottom: '1rem'
  },
  details: {
    display: 'flex',
    gap: '2rem',
    marginBottom: '1rem'
  },
  rating: {
    color: '#ff6b35',
    fontWeight: 'bold'
  },
  deliveryTime: {
    color: '#666'
  },
  address: {
    color: '#666'
  },
  menuSection: {
    marginTop: '2rem'
  },
  menuTitle: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
    marginBottom: '1rem'
  },
  grid: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fill, minmax(280px, 1fr))',
    gap: '1.5rem'
  },
  loading: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem'
  },
  error: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem',
    color: '#c33'
  },
  empty: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem',
    color: '#666'
  }
};

export default RestaurantMenu;
